actionConfiguration.body:
tenant => {
  let options = [];
  if (Units.items) {
    let temp = Units.items;
    if (tenant) {
      temp = Units.items.filter(function (item) {
        return item._pp_tenant_value === tenant;
      });
    }
    temp.forEach(function (item) {
      options.push({
        label: item.pp_name,
        value: item.pp_unitid
      });
    });
  }
  return options;
}

